import React from 'react';
import {
  Collapse,
  List,
  ListItem,
  ListItemText,
} from '@material-ui/core';

export default function EmployeeDetail(props){
  const [open, setOpen] = React.useState(false);
  console.log(props.employee);
  const handleClick = () =>{
    setOpen(!open);
  };
  return(
    <>
      <ListItem button onClick={handleClick}>
        <ListItemText primary={props.employee.first_name}/>
        {open ? <p>Less</p> : <p>More</p>}
      </ListItem>
      <Collapse in={open}>
        <List>
          {props.employee.devices.map((device) => (
            <ListItem key={device.id}>
              <ListItemText primary={device.device_type}/>
            </ListItem>
          ))}
        </List>
      </Collapse>
    </>
  );
};
